		function cratQues() {
			var Screen = stage.getChildByName("firScreen");
			randoQ = Math.floor((Math.random() * ((myQnA[mychoice].length) - 1)) + 1);
			while (myQnA[mychoice][randoQ][0][2] == true) {
				randoQ = Math.floor((Math.random() * ((myQnA[mychoice].length) - 1)) + 1);
			}
			console.log(myQnA[mychoice][randoQ][0][1]);
			if (myQnA[mychoice][randoQ][0][1] == "text") {
				var theQ = new createjs.Text();
				theQ.color = "black";
				theQ.font = "bold 20px Arial";
				theQ.x = 250;
				theQ.y = -200;
				theQ.textAlign = "right";
				theQ.text = myQnA[mychoice][randoQ][0][0];
				Screen.addChild(theQ);
				theQ.lineWidth = 450;
				theQ.name = "theQ";
			} else if (myQnA[mychoice][randoQ][0][3] == "pic") {
		
				var theQ = new createjs.Text();
				theQ.color = "black";
				theQ.font = "bold 20px Arial";
				theQ.x = 250;
				theQ.y = -200;
				theQ.textAlign = "right";
				theQ.text = myQnA[mychoice][randoQ][0][0];
				stage.getChildByName("firScreen").addChild(theQ);
				theQ.lineWidth = 350;
				theQ.name = "theQ";
		
				var PixQ = new(myQnA[mychoice][randoQ][0][1]);
		
				stage.getChildByName("firScreen").addChild(PixQ);
		
				PixQ.x = -150;
				PixQ.y = -175;
				PixQ.scaleX = 0.5;
				PixQ.scaleY = 0.5;
				PixQ.name = "pic9";
				GlassFotQ();
		
			}
			stage.addChild(timer);
			TimePerQ = SetTime;
			timerText();
			timer1();
		
		}
		function craetAns() {
			var screen = stage.getChildByName("firScreen");
			lenArray = myQnA[mychoice][randoQ].length - 1;
		
			for (i = 0; i < lenArray; i++) {
				randoA = Math.floor((Math.random() * ((myQnA[mychoice][randoQ].length) - 1)) + 1);
				while (myQnA[mychoice][randoQ][randoA][3] == "Picked") {
					randoA = Math.floor((Math.random() * ((myQnA[mychoice][randoQ].length) - 1)) + 1);
				}
				var ansBox = new lib.answscreen;
				ansBox.x = ansPos[i][0];
				ansBox.y = ansPos[i][1];
				ansBox.name = "ans" + i;
				stage.addChild(ansBox);
				ansBox.addEventListener("click", highlightAns);
				if (myQnA[mychoice][randoQ][randoA][2] == true) {
					CorrectAns = i;
				}
		
		
				if (myQnA[mychoice][randoQ][randoA][1] == "text") {
					var option = new createjs.Text();
					option.color = "black";
					option.font = "bold 16px Arial";
					option.x = ansPos[i][0] - 5;
					option.y = ansPos[i][1] - 5;
					option.textAlign = "center";
					option.text = myQnA[mychoice][randoQ][randoA][0];
					stage.addChild(option);
					option.lineWidth = 180;
					option.name = "op" + i;
				} else {
					var picAns = new(myQnA[mychoice][randoQ][randoA][0]);
					console.log(myQnA[mychoice][randoQ][randoA][0]);
					stage.addChild(picAns);
					picAns.x = ansPos[i][0] + 5; //temp
					picAns.y = ansPos[i][1] + 5;
					picAns.scaleX = 0.5;
					picAns.scaleY = 0.3;
					picAns.name = "op" + i;
					magGlass(ansBox.x - 70, ansBox.y - 20, i);
		
		
				}
				myQnA[mychoice][randoQ][randoA][3] = "Picked"; // העברת המסיח למצב שהוא הופיע כבר - על מנת שלא יחזור
			}
		
		}
		
		
		
		function timer1() {
			timeInter = setInterval(function () {
				TimePerQ--;
				AllTime++;
				timer.text = TimePerQ; //בשביל שיתעדכן כל שנייה
				if (TimePerQ == 0) {
					timeOut();
				}
			}, 1000);
		}
